selector_to_html = {"a[href=\"#gy-70u\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><strong>GY-70U</strong> \u6709\u7ebf\u626b\u63cf\u67aa\u5feb\u901f\u8bbe\u7f6e\u624b\u518c<a class=\"headerlink\" href=\"#gy-70u\" title=\"Link to this heading\">#</a></h1>", "a[href=\"scanmode.html#key-trigger-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Tasto Innesco<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Premere il pulsante per attivare la scansione e rilasciare il pulsante per terminare la scansione. La scansione termina quando la scansione ha successo o il tempo di lettura supera il tempo di lettura singolo.</p>", "a[href=\"system.html#restore-default-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Ripristina Impostazioni Predefinite<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>Quando si verifica un errore sconosciuto sullo scanner, \u00e8 possibile ripristinare lo scanner ripristinando le impostazioni predefinite.</p>", "a[href=\"scanmode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Scansione<a class=\"headerlink\" href=\"#scan-mode\" title=\"Link to this heading\">#</a></h1><h2>Avvia Configurazione<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"character.html#tab-tab\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Tab(TAB)<a class=\"headerlink\" href=\"#tab-tab\" title=\"Link to this heading\">#</a></h2>", "a[href=\"system.html#start-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Avvia Configurazione<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"character.html#no-end-character\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Nessun Carattere Finale<a class=\"headerlink\" href=\"#no-end-character\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#d-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Simbologie 1D<a class=\"headerlink\" href=\"#d-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"scanmode.html#continuous-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Continua<a class=\"headerlink\" href=\"#continuous-mode\" title=\"Link to this heading\">#</a></h2><p>Lo scanner funziona in modo continuo. Se la scansione \u00e8 riuscita o il tempo di scansione supera il tempo di lavoro singolo, la scansione corrente termina. Se il tempo supera il tempo specificato, la scansione successiva viene attivata automaticamente.</p>", "a[href=\"system.html#end-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Termina L\u2019Impostazione<a class=\"headerlink\" href=\"#end-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"character.html#new-line-lf\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Nuova Linea (LF)<a class=\"headerlink\" href=\"#new-line-lf\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#start-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Avvia Configurazione<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"system.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Impostazioni di Sistema<a class=\"headerlink\" href=\"#system-settings\" title=\"Link to this heading\">#</a></h1><h2>Avvia Configurazione<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"scanmode.html#auto-sensing-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Di Sensibilit\u00e0 Automatica<a class=\"headerlink\" href=\"#auto-sensing-mode\" title=\"Link to this heading\">#</a></h2><p>Nella modalit\u00e0 di rilevamento automatico, lo scanner rileva la luminosit\u00e0 dell\u2019ambiente circostante. Quando la luminosit\u00e0 cambia, la scansione viene attivata. La scansione termina quando la scansione ha successo o il tempo di scansione supera il tempo di lavoro singolo. Indipendentemente dal fatto che l\u2019ultima scansione abbia avuto successo o fallito, la luminosit\u00e0 dell\u2019ambiente circostante verr\u00e0 nuovamente rilevata.</p>", "a[href=\"barcode.html#id1\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Simbologie 2D<a class=\"headerlink\" href=\"#id1\" title=\"Link to this heading\">#</a></h2>", "a[href=\"character.html#start-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Avvia Configurazione<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"system.html#volume-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Impostazioni Volume<a class=\"headerlink\" href=\"#volume-settings\" title=\"Link to this heading\">#</a></h2><p>Scansiona il codice di impostazione corrispondente per attivare/disattivare il prompt del suono dello scanner</p>", "a[href=\"barcode.html#end-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Termina L\u2019Impostazione<a class=\"headerlink\" href=\"#end-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"character.html#enter-cr\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Enter(CR)<a class=\"headerlink\" href=\"#enter-cr\" title=\"Link to this heading\">#</a></h2>", "a[href=\"scanmode.html#start-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Avvia Configurazione<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"character.html#end-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Termina L\u2019Impostazione<a class=\"headerlink\" href=\"#end-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Simbologie<a class=\"headerlink\" href=\"#symbologies\" title=\"Link to this heading\">#</a></h1><h2>Avvia Configurazione<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"character.html#enter-new-line-crlf\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Enter+New Line (CRLF)<a class=\"headerlink\" href=\"#enter-new-line-crlf\" title=\"Link to this heading\">#</a></h2>", "a[href=\"character.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Impostazioni Dei Caratteri Finali<a class=\"headerlink\" href=\"#end-character-settings\" title=\"Link to this heading\">#</a></h1><p>Il carattere finale viene aggiunto dopo i dati decodificati nel formato dei dati decodificati + carattere finale.</p>", "a[href=\"scanmode.html#end-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Termina L\u2019Impostazione<a class=\"headerlink\" href=\"#end-setup\" title=\"Link to this heading\">#</a></h2>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
